import {createSlice} from '@reduxjs/toolkit'

const initialState =[
    { id:"1", title:"Do something", categoryId:"2", createdDate:"05-05-2022 12:40:00", deadlineDate:"5/10/2022 12:40:00 PM", isDone:"True", doneDate:"5/10/2022 12:20:00 PM"},
]

const toDoTasksSlice = createSlice({
    name: 'toDoTasks',
    initialState,
    reducers:{}
})

export default toDoTasksSlice.reducer
